import './App.css';
import {useState} from 'react';

export default function App() {
  const [sitesActive, setSitesActive] = useState(true);

  return (
    <div className="App">
      <div className="LeftNav">
        <div className="LeftNavHeader">
          <span className="LeftNavHeaderOption"
            onClick={() => setSitesActive(true)}
            style={{
              color: sitesActive ? "white" : "rgba(255,255,255,0.5)"
            }}>Sites</span>
          <span className="LeftNavHeaderOption"
            onClick={() => setSitesActive(false)}
            style={{
              color: sitesActive ? "rgba(255,255,255,0.5)" : "white"
            }}>People</span>
        </div>
      </div>
      <div className="MiddleNav"></div>
    </div>
  );
}
